import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppComponent } from './app.component';
import { ListComponent } from './list/list.component';
import { UncompletedComponent } from './uncompleted/uncompleted.component';
import { CompletedComponent } from './completed/completed.component';
import { LowPriorityComponent } from './low-priority/low-priority.component';
import { MediumPriorityComponent } from './medium-priority/medium-priority.component';
import { HighPriorityComponent } from './high-priority/high-priority.component';

@NgModule({
  declarations: [
    AppComponent,
    ListComponent,
    UncompletedComponent,
    CompletedComponent,
    LowPriorityComponent,
    MediumPriorityComponent,
    HighPriorityComponent
  ],
  imports: [
    BrowserModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
